INSERT INTO `v1_47ef9d0b364574b0834f9efaca1f9b7252cdb199725f848f794786ec3c7ea026` VALUES ("魔法防御力（ダウン不可）アップ", "boss_magic_def_lower_limit", 76020005, "バトル開始時、すべてのモンスターの魔法防御力を中アップさせる。この効果は魔法防御力ダウンの影響を受けない。", 602000504);
